	public:
		template<long INTERNALBLOCK>
		static inline bool Phasor(const double* freqs, double** __restrict outputs, const long blockSize, const long channels, const double oneOverSamplerate, double* __restrict history) {
			if (blockSize < INTERNALBLOCK) return false;
			long blocks = blockSize / INTERNALBLOCK;
			//This assumes the same frequency over the entire block
			for (long ch = 0; ch < channels; ++ch) {
				for (long i = 0; i < blocks; ++i) {
					double rate = freqs[ch] * oneOverSamplerate;
					double base = history[ch];
					if (base + rate * (INTERNALBLOCK - 1) < 1.0) { //If the last value will be under 1 do not mod1
						for (long j = 0; j < INTERNALBLOCK; ++j) {
							outputs[ch][i * INTERNALBLOCK + j] = base + rate * j;
						}
					}
					else {
						for (int j = 0; j < INTERNALBLOCK; ++j) { //mod1 if it will be over 1
							outputs[ch][i * INTERNALBLOCK + j] = GfUtils::mod(base + rate * j);
						}
					}
					history[ch] = GfUtils::mod(base + rate * (INTERNALBLOCK));
				}
			}
			return true;
		};

		template<long INTERNALBLOCK>
		static inline bool Sine(const double* freqs, double** __restrict outputs, const long blockSize, const long channels, const double oneOverSamplerate, double* __restrict history) {
			if (blockSize < INTERNALBLOCK) return false;
			long blocks = blockSize / INTERNALBLOCK;
			//This assumes the same frequency over the entire block
			for (long ch = 0; ch < channels; ch++) {
				for (long i = 0; i < blocks; i++) {
					double rate = freqs[ch] * oneOverSamplerate;
					double base = history[ch];

					if (base + rate * (INTERNALBLOCK - 1) < 1.0) { //If the last value will be under 1 do not mod1
						for (long j = 0; j < INTERNALBLOCK; ++j) {
							auto pos = base + rate * j;
							auto p1 = (long)(pos * 4096);
							auto p2 = p1 + 1;
							auto a = (pos * 4096) - p1;
							outputs[ch][i * INTERNALBLOCK + j] = SINEWAVE[p1] * (1.0 - a) + SINEWAVE[p2] * a;
						}
					}
					else {
						for (int j = 0; j < INTERNALBLOCK; ++j) { //mod1 if it will be over 1
							auto pos = GfUtils::mod(base + rate * j);
							auto p1 = (long)(pos * 4096);
							auto p2 = p1 + 1;
							auto a = (pos * 4096) - p1;
							outputs[ch][i * INTERNALBLOCK + j] = SINEWAVE[p1] * (1.0 - a) + SINEWAVE[p2] * a;
						}
					}

					history[ch] = GfUtils::mod(base + rate * (INTERNALBLOCK));
				}
			}
			return true;
		};
